import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { Link, useNavigate, useParams } from 'react-router-dom';
import DatePicker from 'react-datepicker';
import './Voir_Demande.css';

const Voir_Demande = () => {
  const { id } = useParams();
  const [myuser, setMyUser] = useState([]);
  const [userDemande, SetuserDemande] = useState([]);
  const [filteredData, setFilteredData] = useState([]);
  const [name, setName] = useState("");
  const [post, setPost] = useState("");
  const [solde, setSolde] = useState(30);
  const [Motif, setMotif] = useState("");
  const [DateD, setDateD] = useState(new Date()); 
  const [DateFt, setDateFt] = useState(new Date()); 
  const [Numero, setNumero] = useState(0);
  const [newID, setnewID] = useState(id);
  const [typeDemande, setTypeDemande] = useState("conge"); 
  const [errors, setErrors] = useState([]);
  const nav = useNavigate();

  useEffect(() => {
    axios.get(`http://localhost:5000/Data/${id}`)
      .then((res) => {
        console.log(res.data);
        setMyUser(res.data);
        setName(res.data.name);
        setPost(res.data.post);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [id]);

  useEffect(() => {
    axios.get(`http://localhost:5000/Demande`)
      .then((res) => {
        SetuserDemande(res.data);
        const filtered = res.data.filter((item) => item.ID === newID);
        console.log(filtered);
        setFilteredData(filtered);
        if (filtered.length > 0) {
          setDateD(new Date(filtered[0].DateD));
          setDateFt(new Date(filtered[0].DateFt));
          setSolde(filtered[0].solde);
          setNumero(filtered[0].Numero);
          setMotif(filtered[0].Motif);
          setTypeDemande(filtered[0].typeDemande);  
        }
      })
      .catch((err) => {
        const errorResponse = err.response.data.errors;
        console.log(errorResponse);
        const errorArr = [];
        for (const key of Object.keys(errorResponse)) {
          errorArr.push(errorResponse[key].message);
        }
        setErrors(errorArr);
      });
  }, [id]);

  const Back = () => {
    axios.get(`http://localhost:5000/Data`)
      .then((res) => {
        console.log(res.data);
        const filtered = res.data.filter((item) => item.post.toUpperCase() === 'RH');
        console.log(filtered);
        if (filtered.length > 0) {
          console.log(filtered[0]._id);
          const newID = filtered[0]._id;
          console.log(newID);
          nav(`/validation/${newID}`);
        }
      });
  };

  return (
    <div className="demande-container">
      {errors.map((err, index) => <p key={index} className="error-message">{err}</p>)}
      
      <div className="header">
        <p>Nom de salarié : {myuser.name}</p>
        <button onClick={Back} className="back-button"><Link>Revenir</Link></button>
        <Link to="/" className="home-link">Accueil</Link>
      </div>

      <div className="demande-details">
        <p>Post : {myuser.post}</p>
        <p>Solde de congé : {solde}</p>

        <div className="field-group">
          <label>Type de demande :</label>
          <select id={id} value={typeDemande} disabled className="select-box">
            <option value="conge">conge</option>
            <option value="autorisation">autorisation</option>
          </select>
        </div>

        <div className="field-group">
          <label>De :</label>
          <DatePicker
            showIcon
            selected={DateD}
            readOnly
            disabled
            className="date-picker"
          />
        </div>

        <div className="field-group">
          <label>A :</label>
          <DatePicker
            showIcon
            selected={DateFt}
            readOnly
            disabled
            className="date-picker"
          />
        </div>

        {typeDemande !== "conge" && (
          <div className="field-group">
            <label>Numéro de Heure : </label>
            <div className="number-input-group">
              <button className="number-btn" disabled>-</button>
              <input type="text" value={Numero} readOnly className="number-input" />
              <button className="number-btn" disabled>+</button>
            </div>
          </div>
        )}

        <div className="field-group">
          <label>Motif :</label>
          <textarea 
            value={Motif}
            readOnly
            disabled
            className="motif-textarea"
          ></textarea>
        </div>
      </div>
    </div>
  );
};

export default Voir_Demande;
